import React, { Component } from 'react';

class ButtonComponent extends Component {

    constructor(props) {
        super(props);
        this.state = {
            numClicks: 0
        }
    }

    click() {
        this.setState({ numClicks: this.state.numClicks + 1 });
    }

    render() {
        return  (
            <div>
                <button onClick={this.click.bind(this)}>Click Me</button>
                {this.state.numClicks}
            </div>
        );
    }
}
